function.block:
{

int a, b, c; 

al_fixed d; 

if (x >= 0) { 

a = 0;

b = 127;

}

else { 

a = 128;

b = 255;

}

do {

c = (a + b) >> 1;

d = x - _al_fix_tan_tbl[c];

if (d > 0)

a = c + 1;

else

if (d < 0)

b = c - 1;

} while ((a <= b) && (d));

if (x >= 0)

return ((long)c) << 15;

return (-0x00800000L + (((long)c) << 15));

}

{

al_fixed r;

if (x==0) {

if (y==0) {

al_set_errno(EDOM);

return 0L;

}

else

return ((y < 0) ? -0x00400000L : 0x00400000L);

}

al_set_errno(0);

r = al_fixdiv(y, x);

if (al_get_errno()) {

al_set_errno(0);

return ((y < 0) ? -0x00400000L : 0x00400000L);

}

r = al_fixatan(r);

if (x >= 0)

return r;

if (y >= 0)

return 0x00800000L + r;

return r - 0x00800000L;

}

{

if (x > 0)

return al_ftofix(sqrt(al_fixtof(x)));

if (x < 0)

al_set_errno(EDOM);

return 0;

}
